process {
    $currentLineNumber += 1
    $global:statistics.rowsProcessed += 1

    # Make sure we got something
    if (!$line) { Write-Error "Line $currentLineNumber does not contain any data"; return }

    # normalize 
    <#
        Specific for science, depending on file encoding "’" come as different characters, normalize to "'"
    #>
    # "U+2019 ’ could be confused with the character U+0060"
    $line = $line.Replace("’", "'").Replace("Õ", "'")
    

    # 3 first rows compose the file headers the first line then output all of the headers
    if ($currentLineNumber -le 3) { 

        Write-Information "Process Headers... line:$($currentLineNumber) ($global:SUBJECT)"

        # We assume headers will not have commas in the names
        #$headerRow = $line.Split(", ")    
        $headerRow = Get-ParsedRecordArrayV2 -line $line
        
        #all 3 first rows have information needed to compose header linestuId Index -> 

        # row 1 - Subject and Grade Level
        if ($currentLineNumber -eq 1) {
            for ($i = 0; $i -lt $headerRow.Count; $i++) {
                $item = $headerRow[$i]

                # skip empty header value
                if (!$item) {
                    continue
                } 

                $r1_subject = $null
                $gradeLevel = $null

                # subject
                foreach ($s in $global:LOOKUP_HEADER_SUBJECT.Keys) {
                    if ($item.Contains($s)) {
                        $r1_subject = $global:LOOKUP_HEADER_SUBJECT[$s] 
                        break
                    }
                }

                # grade level
                foreach ($gl in $global:LOOKUP_HEADER_GRADE_LEVEL.Keys) {
                    if ( $item.Contains($gl)) {
                        $gradeLevel = $global:LOOKUP_HEADER_GRADE_LEVEL[$gl]
                        break
                    }
                }
 
                $colId = Get-ColumnId -index $i

                # Only process current subject columns
                if ($r1_subject -and $r1_subject -eq $global:SUBJECT) {
                    if ($global:LOOKUP_HEADER_INDEX.ContainsKey($colId)) {
                        $global:LOOKUP_HEADER_INDEX[$global:HEADER_INDEX_PROP_Subject] = $r1_subject
                        $global:LOOKUP_HEADER_INDEX[$global:HEADER_INDEX_PROP_GradeLevel] = $gradeLevel
                    }
                    else {
                        $global:LOOKUP_HEADER_INDEX.Add($colId , @{ 
                                $global:HEADER_INDEX_PROP_Subject    = $r1_subject
                                $global:HEADER_INDEX_PROP_GradeLevel = $gradeLevel
                            })
                    }
                }
            }
            # return empty - headers are not done yet
            return
        }

        # row 2 - Reporting Category
        if ($currentLineNumber -eq 2) {
            for ($i = 0; $i -lt $headerRow.Count; $i++) {
                $item = $headerRow[$i]

                $colId = Get-ColumnId -index $i

                # subject
                $r2_subject = $null
                if ($global:LOOKUP_HEADER_INDEX.ContainsKey($colId) -and $global:LOOKUP_HEADER_INDEX[$colId].Keys -contains $global:HEADER_INDEX_PROP_Subject) {
                    $r2_subject = $($global:LOOKUP_HEADER_INDEX[$colId])[$global:HEADER_INDEX_PROP_Subject]
                }

                if ($null -ne $r2_subject -and $r2_subject -eq $global:SUBJECT) {
                    # add row 2 values to index lookup
                    $colId = Get-ColumnId -index $i
                    $($global:LOOKUP_HEADER_INDEX[$colId]).$global:HEADER_INDEX_PROP_Row2Value = $item
                }
            }
            # return empty - headers are not done yet
            return
        }

        $global:HEADER_COLUMNID_MAP = @{}

        # row 3 - scoreType: Score or Level
        if ($currentLineNumber -eq 3) {
            for ($i = 0; $i -lt $headerRow.Count; $i++) {
                $item = $headerRow[$i]
                $colId = Get-ColumnId -index $i

                # Student Number
                if ($item -eq $global:SRC_COLUMN_STUDENT_ID) {
                    $global:SRC_COLUMN_STUDENT_ID_Index = $i
                }

                # score type
                $scoreType = $null
                foreach ($s in $global:LOOKUP_HEADER_SCORE_TYPE.Keys) {
                    if ( $item.Contains($s)) {
                        $scoreType = $global:LOOKUP_HEADER_SCORE_TYPE[$s] 
                        break
                    }
                }

                # subject
                $r3_subject = $null
                if ($global:LOOKUP_HEADER_INDEX.ContainsKey($colId) -and $global:LOOKUP_HEADER_INDEX[$colId].Keys -contains $global:HEADER_INDEX_PROP_Subject) {
                    $r3_subject = $($global:LOOKUP_HEADER_INDEX[$colId])[$global:HEADER_INDEX_PROP_Subject]
                }
                
                # check if column subject matches the one being processed
                if ($null -ne $r3_subject -and $r3_subject -eq $global:SUBJECT) {
                    #check subject defined in Header lookup
                    if ($global:ASSESSMENT_COLUMNS_BY_SUBJECT.Keys -contains $r3_subject -and $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$r3_subject.Keys -contains $scoreType) {
                        # get grade level
                        $gradeLevel = $null
                        if ($global:LOOKUP_HEADER_INDEX[$colId].Keys -contains $global:HEADER_INDEX_PROP_GradeLevel) {
                            $gradeLevel = $($global:LOOKUP_HEADER_INDEX[$colId])[$global:HEADER_INDEX_PROP_GradeLevel]
                        }
                        #go thru all columns to be reported for current subject
                        foreach ($colNameForScoreType in $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$r3_subject.$scoreType.Keys) {
                            # raw value of reporting category in file
                            $rcValue = $global:LOOKUP_HEADER_INDEX[$colId].$global:HEADER_INDEX_PROP_Row2Value
                            $matched = $false
                            
                            # go thru all possible values to be matched for this column
                            $possibleMatches = $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$r3_subject.$scoreType[$colNameForScoreType]
                            foreach ($v in $possibleMatches) {
                                if ($rcValue -imatch $v) {                                   
                                    $matched = $true
                                    # if matched, current outColumn has index of column
                                    break                   
                                }                        
                            }

                            if ($matched) {
                                # Write-Information "$matched - $colId ->'$outColumnName'"
                                $colName = "{0}_{1}" -f $scoreType, $colNameForScoreType

                                if ($global:HEADER_COLUMNID_MAP.ContainsKey($gradeLevel)) {
                                    $global:HEADER_COLUMNID_MAP[$gradeLevel].Add($colName, $colId)
                                }
                                else {
                                    $global:HEADER_COLUMNID_MAP.add($gradeLevel, @{$colName = $colId })
                                }
                            }
                        }
                    }
                }
            }
        }

        Write-Information "ordered headers"
        
        $outputHeaders = @()
        # only write headers out for current subject

        # Headers/columns
        # 1 - If there are custom headers add to output header line
        if ($global:CUSTOM_COLUMN_MAP.Count) {            
            $outputHeaders += $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )
        }

        #2 Fixed columns for subject
        foreach ($scoreType in $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$global:SUBJECT.Keys) {
            foreach ($colName in $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$global:SUBJECT.$scoreType.Keys) {
                $outputHeaders += "{0}_{1}" -f $scoreType, $colName
            }
        }

        # only write headers when processing row 3, complete headers are assembled with the vaues of rows 1, 2 and 3       
        Write-Output $(Get-CSVLine($outputHeaders))
        return
        #does not return after headers because first line contains values not headers, headers are fixed
    }


    # array, Ordered output values
    $orderedOutputValues = @()

    # HashTable, will hold all input values for current line, used in case computed columns need to reference input values
    # $row = @{}
    
    # Not the cleanest of solutions, but none of the values should have double quotes, replace to remove wrapping quotes if present
    # $row = Get-ParsedRecord -headers $($global:inputHeaders) -line $line
    # $row = ConvertFrom-Csv -InputObject $line -Header $global:inputHeaders

    $rowValues = Get-ParsedRecordArrayV2 -line $line

    Write-Information "currentLine:$currentLineNumber"
    foreach ($gradeLevel in $($global:HEADER_COLUMNID_MAP.Keys | Sort-Object )) {
        
        $orderedOutputValues = @()

        # Validation will tell whether or not a record has the required values needed to be posted to ODS, 
        # if not valid error code and line number will be displayed in the summary
        $passedValidation = $true
        $validationId = $null
        # 1 - Process custom/computed columns
        if ($global:CUSTOM_COLUMN_MAP.Count) {            
            foreach ($outColumnName in  $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )) {
                    
                $srcInfo = $global:CUSTOM_COLUMN_MAP[$outColumnName]
                $srcColName = $srcInfo.SourceColumnName   
            
                ### DataImport Assessment Custom Columns
                switch -Exact ($outColumnName) {
                    # StudentId
                    "DI_StudentId" {
                        
                        $stuIdRawValue = $rowValues[$global:SRC_COLUMN_STUDENT_ID_Index]
                        $stdId = Get-StudentODSId($stuIdRawValue)

                        # Validation, this is a required field, if empty will be unable to post to ODS.
                        if (!$stdId) {
                            $passedValidation = $false
                            $validationId = "InvalidStudentId"
                            break
                        }
    
                        $orderedOutputValues += $stdId
                        break
                    }
    
                    # Admin Date
                    "DI_AdministrationDate" {
                    
                        ## admin date                    
                        $adminDate = "05/20/{0}" -f $global:SCHOOL_YEAR

                    
                        # Validation, this is a required field, if empty will be unable to post to ODS
                        if (!$adminDate) {
                            $passedValidation = $false
                            $validationId = "InvalidAdministrationDate"
                            break
                        }
    
                        $orderedOutputValues += $adminDate
                        break
                    }

                    "DI_SchoolYear" {
                        # take from file name
                        $orderedOutputValues += $global:SCHOOL_YEAR
                        break
                    }
    
                    "DI_AssessedGradeLevel" {
                        $orderedOutputValues += $gradeLevel
                        break
                    }

                    Default {
                        # In case of no implementation for custom column add $null output to preserve output format and order
                        $orderedOutputValues += $null
                        break;
                    }
                }
            }
        }     

        $skipGradeLevel_noData = $false
        #2 Fixed columns for subject
        foreach ($scoreType in $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$global:SUBJECT.Keys) {
            foreach ($colNameForScoreType in $global:ASSESSMENT_COLUMNS_BY_SUBJECT.$global:SUBJECT.$scoreType.Keys) {

                $colName = "{0}_{1}" -f $scoreType, $colNameForScoreType
                $outValue = $null
                if ($global:HEADER_COLUMNID_MAP[$gradeLevel].ContainsKey($colName)) {
                    $index = Get-ColumnIndex -colId $($global:HEADER_COLUMNID_MAP[$gradeLevel].$colName)
                    $val = $rowValues[$index]
                    # some empty values come with '-', discard
                    if ($null -ne $val -and $val -ne "-") {
                        $outValue = $val.trim()
                    }
                }

                # validation, since each row has columns for all grade levels, only process grade levels with Overall Scale score
                if ($colNameForScoreType -imatch "Overall.*Scale Score" -and $null -eq $outValue) {
                    $skipGradeLevel_noData = $true
                }

                $orderedOutputValues += $outValue
            }
        }

        # do not process empty gradeLevels
        if ($skipGradeLevel_noData) {
            Write-Information "Skip grade level $gradeLevel"
            continue
        }

        # If not valid add to statistics to notify user at the end of execution and skip record and do not post current for current row this screening period to ODS
        if (!$passedValidation) {
            # Only print once per row
            if (!$errorInCurrentRow) {
                Write-Warning "Invalid record see statistics summary for details.($currentLineNumber)"
            }            

            # Check if this validation error already added for current screening period
            if ($global:statistics.validations[$validationId]) {
                $global:statistics.validations[$validationId] += $currentLineNumber
            }
            else {
                $global:statistics.validations.Add($validationId, @($currentLineNumber)) | Out-Null
            }
        
            # Skip current line do not pass values to DataImport
            continue
        }
        Write-Output $(Get-CSVLine($orderedOutputValues))
        $global:statistics.rowsLoaded++ 
    }
    
}

end {

    Write-Information "SUMMARY: `
                    Rows Processed: $($global:statistics.rowsProcessed); `
                    Rows Loaded: $($global:statistics.rowsLoaded)"

    foreach ($validationId in $global:statistics.validations.Keys) {
        Write-Warning "Error reason: '$validationId'"                
        Write-Information "Line number(s):"
        $lineNumbers = $global:statistics.validations[$validationId]
        $errorThreshold = 50
        if ($lineNumbers.Count -gt $errorThreshold) {
            Write-Warning "There are $($lineNumbers.Count) lines with errors. Will only print the first $errorThreshold line numbers where errors ocurred."
            $lineNumbers = $lineNumbers[0..$($errorThreshold - 1)]
        }
        Write-Warning "$([string]::Join(",",$lineNumbers))"
    }

}
